import { Transform } from "./Transform"

export const Components = (props) => {
  return <div
    style={{
      margin: 12
    }}
  >
    <h2>GameObject</h2>
    <div>{`Name: ${props.name}`}</div>
    <Transform {...props} />
  </div>
}
